{"1": {"comment_id": "bawanggorengwuenak"  "comment_text": "Minyak kelapa tak hanya digunakan untuk keperluan memasak. Ada beragam manfaat minyak kelapa yang juga baik bagi kesehatan tubuh  mulai dari menurunkan berat badan hingga menjaga kesehatan jantung.   

